    const user = useContext(AuthContext)
    const Render = null
    if (user.id !== null) {
    Render = <Message positive><p>You are logged in as {user.email}</p></Message>
    }
    return(
        <Message positive>
            <p>You are logged in as {}</p>
        </Message>
    )
}
